import React from 'react'
import styled from 'styled-components'


const ButtonStyled= styled.div`
display: inline-flex;
border: 2px solid white;
border-radius: .4em;
min-width: 128px;
padding: .7em;
box-sizing: border-box;
justify-content: center;
font-weight: 700;
cursor: pointer;
`



export default function Button() {
    return (
        <ButtonStyled>
        RULES
        </ButtonStyled>
    )
}
